import React from "react";
import "./Footer.css";
function Footer() {
  return (
    <div className="footer">
      <div className="blockchainStack">
        <img src="https://blockgeeks.com/wp-content/uploads/2020/03/infura_logo_black-240x220.png" />
        +{" "}
        <img src="https://www.pinclipart.com/picdir/big/423-4237777_eth-icon-cryptocurrency-flat-transparent-background-ethereum-clipart.png" />
      </div>
    </div>
  );
}

export default Footer;
